    <style>
        html {
            font-family: sans-serif
        }

        body {
            margin: 0
        }

        a {
            background-color: transparent
        }

        a:active,
        a:hover {
            outline: 0 none
        }

        img {
            border: 0 none
        }

        svg:not(:root) {
            overflow: hidden
        }

        button,
        input {
            color: inherit;
            font: inherit;
            margin: 0
        }

        button {
            overflow: visible
        }

        button {
            text-transform: none
        }

        button,
        html input[type=button],
        input[type=reset],
        input[type=submit] {
            cursor: pointer
        }

        button::-moz-focus-inner,
        input::-moz-focus-inner {
            border: 0 none;
            padding: 0
        }

        input {
            line-height: normal
        }

        input[type=checkbox],
        input[type=radio] {
            box-sizing: border-box;
            padding: 0
        }

        * {
            box-sizing: border-box
        }

        ::after,
        ::before {
            box-sizing: border-box
        }

        button,
        input {
            font-family: inherit;
            font-size: inherit;
            line-height: inherit
        }

        a:focus {
            outline: thin dotted;
            outline-offset: -2px
        }

        img {
            vertical-align: middle
        }

        html {
            font-size: 100%
        }

        body {

        a {

            text-decoration: none
        }

        a:link {

        }

        a:visited {
            color: #0067b8
        }

        }
